import React from "react";
import CartProvider from "../../store/CartProvider";
import Orders from "./components/Orders";
import { AuthProvider } from "./components/auth/Auth";

const Admin = () => {
  return (
    <AuthProvider>
      <CartProvider>
        <Orders/>
      </CartProvider>
    </AuthProvider>
  );
};

export default Admin;
